import "./App.css";
import { useState, useEffect, useRef } from "react";

interface StationData {
  name: string;
  globalId: string;
  transportTypes: string[];
  distanceInMeters: number;
  aliases: string[];
  tariffZones: string[];
}

interface DepartureData {
  transportType: string;
  label: string;
  destination: string;
  plannedDepartureTime: string;
  realtimeDepartureTime: string;
  delayInMinutes: number;
  cancelled: boolean;
  occupancy: string;
}

export default function Component() {
  const [stationData, setStationData] = useState<StationData | null>(null);
  const [departureData, setDepartureData] = useState<DepartureData[] | null>(null);
  const [error, setError] = useState<string | null>(null);
  const [showDepartures, setShowDepartures] = useState(false);
  const canvasRef = useRef<HTMLCanvasElement | null>(null);

  async function queryMvg(lat: number, lon: number) {
    try {
      const response = await fetch(
        `https://www.mvg.de/api/fib/v2/station/nearby?latitude=${lat}&longitude=${lon}`
      );
      if (!response.ok) throw new Error("Failed to fetch data from MVG API");
      const data = await response.json();
      setStationData(data[0]);

      const stationId = data[0].globalId;
      const departureResponse = await fetch(
        `https://www.mvg.de/api/fib/v2/departure?globalId=${stationId}&limit=10&offsetInMinutes=0`
      );
      if (!departureResponse.ok) throw new Error("Failed to fetch departure data from MVG API");
      const departureData = await departureResponse.json();
      setDepartureData(departureData);
    } catch (error) {
      setError(error instanceof Error ? error.message : String(error));
    }
  }

  useEffect(() => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        async (position) => {
          const { latitude, longitude } = position.coords;
          await queryMvg(latitude, longitude);
        },
        (error) => {
          setError(getGeolocationErrorMessage(error));
        }
      );
    } else {
      setError("Geolocation not supported");
    }
  }, []);

  useEffect(() => {
    if (stationData && canvasRef.current) {
      const canvas = canvasRef.current;
      const ctx = canvas.getContext('2d');
      if (ctx) {
        drawStationBubble(ctx, canvas.width / 2, canvas.height / 2, stationData);
      }
    }
  }, [stationData]);

  function drawStationBubble(ctx: CanvasRenderingContext2D, x: number, y: number, station: StationData) {
    ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height);
    ctx.beginPath();
    ctx.arc(x, y, 100, 0, 2 * Math.PI);
    ctx.fillStyle = 'rgba(0, 123, 255, 0.7)';
    ctx.fill();
    ctx.strokeStyle = 'white';
    ctx.lineWidth = 2;
    ctx.stroke();

    ctx.fillStyle = 'white';
    ctx.font = '16px Arial';
    ctx.textAlign = 'center';
    ctx.fillText(station.name, x, y - 20);

    ctx.font = '14px Arial';
    station.transportTypes.forEach((type, index) => {
      ctx.fillText(type, x, y + 10 + index * 20);
    });
  }

  function handleCanvasClick() {
    setShowDepartures(!showDepartures);
  }

  function getGeolocationErrorMessage(error: GeolocationPositionError): string {
    switch (error.code) {
      case error.PERMISSION_DENIED:
        return "User denied the request for Geolocation.";
      case error.POSITION_UNAVAILABLE:
        return "Location information is unavailable.";
      case error.TIMEOUT:
        return "The request to get user location timed out.";
      default:
        return "An unknown error occurred.";
    }
  }

  return (
    <div className="app-container">
      {error && <p className="text-red-500 mb-4">{error}</p>}
      {stationData && (
        <div className="canvas-container">
          <canvas
            ref={canvasRef}
            width={390}
            height={844}
            onClick={handleCanvasClick}
            className="station-canvas"
          />
        </div>
      )}
      {showDepartures && departureData && (
        <div className="departure-info">
          <h2 className="text-2xl font-bold mb-4">Departure Information</h2>
          {departureData.map((departure, index) => (
            <div key={index} className="departure-item">
              <p className={`font-semibold ${departure.cancelled ? 'text-red-500' : ''}`}>
                {departure.transportType} {departure.label} to {departure.destination}
              </p>
              <p>Planned: {new Date(departure.plannedDepartureTime).toLocaleTimeString()}</p>
              <p>Realtime: {new Date(departure.realtimeDepartureTime).toLocaleTimeString()}</p>
              {departure.delayInMinutes > 0 && (
                <p className="text-orange-500">Delay: {departure.delayInMinutes} min</p>
              )}
              <p>Occupancy: {departure.occupancy}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
